import { movies } from "./data/movies"
import MovieBox from "./components/movieBox";
import {styless} from "./app.module.css"

function App() {
  return (
    <div>
      <h1>영화 목록</h1>
      <ul>
        {movies.results.map(movie => (
          <li key={movie.id}>
            <MovieBox
            img={movie.backdrop_path}
            title={movie.title}
            overview={movie.vote_average}
            />
          </li>
        ))}
      </ul>
    </div>
  );
}

export default App;
